import {GET_TIMESLOT} from '../actions/timeslotAction'

const initialState={}

const timeslotReducer=(state=initialState,action)=>{
    const {type,payload}=action
    switch(type){
        case  GET_TIMESLOT:
            return{
                ...state,
                ...payload
            }
    }
}
